import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Link,
  Route,
  Switch
} from 'react-router-dom';
import Main from './Main.js';

function App() {
  return (
    <div className="App">
      <Router>
        <nav id="nav">
          <div id="about-div">
            <Link to='/about'>
              <button className="btn btn-dark">About</button>
            </Link>
          </div>
          <div>

          </div>
        </nav>
        <div className="container">

        </div>

        <Switch>
          <Route exact path="/">
            <Main />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
